import React from "react";
import Main from "./components/Main";
import Wrapper from "./components/Wrapper";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Wrapper>
        <Main />
      </Wrapper>
    </div>
  );
}

export default App;
